import React, { Component } from 'react'
import styled from 'styled-components'
import { FlexboxCenter } from '../StyledCom/flexbox.js'

const testProps2 = (props) => {
    let propsColor = props.secondChildValue === "success" ? '#E07667' : "#000000";
    return(
        <div style={{
            height: "200px",
            width: "300px",
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
            alignItems: "center",
            backgroundColor: "#CCCCCC",
            borderRadius: "25px",
            boxShadow: "5px 10px",
            margin: "20px"
        }}>
            <span>Second child</span>
            <button>God btn reset</button>
            <span style={{
                color : propsColor
            }}>
                {props.secondChildValue}
            </span>
        </div>
    );
}

export default testProps2
